import React from 'react';
import CartItem from './CartItem'
const Cart = (props) => {
  return (
    <div>
      {props.items.map( (item)=> <CartItem
        key={item.id}
        name={item.name}
        description={item.description}
        pri
      />)}
    
    </div>
  )
}

export default Cart;
